import React from "react";

function Nav(props) {
    const {homeState, setHomeState, activeState, setActiveState } = props;

    return (
        <>
        <ul>
            <li>
                <a href="#project" 
                    onClick={() => setHomeState(false)} 
                    className={`${activeState && 'navActive'}
                                ${!homeState && 'nav-secondary'}
                    `}>
                    PROJECTS
                </a>
            </li>
            <li>
                <a href="#about" 
                    onClick = {() => {
                        setActiveState(true);
                        setHomeState(false)
                    }} 
                    className={`${activeState && 'navActive'}
                                ${!homeState && 'nav-secondary'}
                    `}> ABOUT
                </a>
            </li>
            <li>
                <a href="#contact">CONTACT</a>
            </li>
            <li>
                <a href="Resume/LisaLeResume.pdf" target="_blank">RESUME</a>
            </li>
        </ul>

        <div id="navigation" class="logo">
            <a className="slice" href="/" onClick={()=> setHomeState(true)}>
                <div className="top"><span>Lisa Le</span></div>
                <div className="bottom"><span>Lisa Le</span></div>
            </a>
        </div>
        </>
    )
}

export default Nav;
